package ship.data.reader.sh4.image.processor;

import static org.junit.Assert.assertEquals;
import static ship.data.reader.sh4.DataReaderConstants.NO_DATA_IMAGE_B64;
import static ship.data.reader.sh4.DataReaderConstants.RESOURCES_PATH;
import static ship.data.reader.sh4.DataReaderConstants.SFS;

import java.awt.image.BufferedImage;
import java.io.File;
import java.io.IOException;

import org.junit.Before;
import org.junit.Ignore;
import org.junit.Test;

public class ImageProcessorImplTest {

	String testImageDirPath = RESOURCES_PATH +SFS+ "ship" +SFS+ "data" +SFS+ "reader" +SFS+ "sh4" +SFS+ "image" +SFS+ "processor" +SFS+ "testImages" +SFS+ "NBB_Iowa_sil.dds";
	String b64IowaTestImage = "";
	ImageProcessorImpl proc;
	
	@Before
	public void setUp() {
		proc = new ImageProcessorImpl();
	}

	@Test
	public void testReadDdsFileToBufferedImage() throws IOException {
		BufferedImage image1 = proc.readDdsFileToBufferedImage(testImageDirPath);
		
		assertEquals(b64IowaTestImage, proc.bufferedImageToB64Png(image1)); //parseOK

		assertEquals(NO_DATA_IMAGE_B64, proc.bufferedImageToB64Png(proc.readDdsFileToBufferedImage(new File(testImageDirPath).getParentFile().getCanonicalPath()))); //Parse no file, return no data image
		assertEquals(NO_DATA_IMAGE_B64, proc.bufferedImageToB64Png(proc.readDdsFileToBufferedImage(""))); //Null file, return no data image
	}

	@Test
	public void testBufferedImageToB64Png() {
		BufferedImage image1 = proc.readDdsFileToBufferedImage(testImageDirPath);
		
		assertEquals(b64IowaTestImage, proc.bufferedImageToB64Png(image1)); //OK
		assertEquals(NO_DATA_IMAGE_B64, proc.bufferedImageToB64Png(null));	//Null image	
	}

	@Test
	public void testB64PngToBufferedImage() {
		BufferedImage image1 = proc.readDdsFileToBufferedImage(testImageDirPath);
		assertEquals(b64IowaTestImage, proc.bufferedImageToB64Png(proc.b64PngToBufferedImage(b64IowaTestImage)));
	}

}
